  getDocs,
  deleteDoc,
  addDoc,
  doc,
} from "firebase/firestore";
import { useAuth } from "./firebase";
import { theDate } from "./Utilities/theDate";
import RandomPost from "./makeRandomPost";
import { NavLink } from "react-router-dom";

export default function LoggedIn() {
  const currentUser = useAuth();

  return (
    <div nav-writing-exc>
      <div>Hey: {currentUser?.email} </div>
      <ul className="writing-excercises-grid">
        <li className="nav-link">
          <NavLink activestyle={{ color: "red" }} to="/watch">
            {" "}
            Shows{" "}
          </NavLink>
        </li>
        <li className="nav-link">
          <NavLink activestyle={{ color: "red" }} to="/randompost">
            {" "}
            Random Post{" "}
          </NavLink>
        </li>
        <li className="nav-link">
          <NavLink activestyle={{ color: "red" }} to="/activities">
            {" "}
            Things to do
          </NavLink>
        </li>
        <li className="nav-link">
          <NavLink activestyle={{ color: "red" }} to="/places">
            {" "}
            Places to go
          </NavLink>
        </li>
      </ul>
    </div>
  );
}
